import React from 'react'
import './UI.css'
const UI = () => {
    return(
        <div className="dashboard">
            <h1>Air Quality Sensors</h1>
            <img src="data:image/svg+xml;base64," sizes="100px"/>
            <h2 className="airValue">39</h2>
        </div>
    )
}

export default UI
